import React from 'react';
import style from './FormInput.module.css'


const FormInput = ({inputChange, currentInput, clearInput}) => {
    return(
        <input onChange={inputChange} onFocus={(e) => e.target.value === currentInput ? e.target.value = '' : null} className={style.input} type="text" placeholder="Add items"/>
    );
}

export default FormInput;
